import React, { useState } from 'react';

// Email and lock icons as SVG components for better control
const EmailIcon = () => (
  <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke="currentColor" className="w-5 h-5">
    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M3 8l7.89 5.26a2 2 0 002.22 0L21 8M5 19h14a2 2 0 002-2V7a2 2 0 00-2-2H5a2 2 0 00-2 2v10a2 2 0 002 2z" />
  </svg>
);

const LockIcon = () => (
  <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke="currentColor" className="w-5 h-5">
    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 15v2m-6 4h12a2 2 0 002-2v-6a2 2 0 00-2-2H6a2 2 0 00-2 2v6a2 2 0 002 2zm10-10V7a4 4 0 00-8 0v4h8z" />
  </svg>
);

const LoginPage = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [rememberMe, setRememberMe] = useState(false);

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle login logic here
    console.log('Login attempt with:', { email, password, rememberMe });
  };

  return (
    <div className="p-4 max-w-md mx-auto">
      <h1 className="text-4xl font-bold mb-6">Login</h1>

      <form onSubmit={handleSubmit} className="space-y-4">
        {/* Email Input */}
        <div className="relative">
          <div className="absolute left-3 top-1/2 -translate-y-1/2 text-gray-500">
            <EmailIcon />
          </div>
          <input 
            type="email" 
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            placeholder="1@gmail.com"
            className="w-full pl-10 pr-3 py-2 bg-blue-50 border border-gray-300 rounded"
            required
          />
        </div>

        {/* Password Input */}
        <div className="relative">
          <div className="absolute left-3 top-1/2 -translate-y-1/2 text-gray-500">
            <LockIcon />
          </div>
          <input 
            type="password" 
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            placeholder="••••••"
            className="w-full pl-10 pr-3 py-2 bg-blue-50 border border-gray-300 rounded"
            required
          />
        </div>

        {/* Remember Me */}
        <div className="flex items-center">
          <input 
            type="checkbox" 
            id="remember" 
            checked={rememberMe}
            onChange={(e) => setRememberMe(e.target.checked)}
            className="mr-2"
          />
          <label htmlFor="remember">Remember me</label>
        </div>

        {/* Forgot Password */}
        <div>
          <a href="/forgot-password" className="text-blue-600 underline">
            Forgot Password?
          </a>
        </div>

        {/* Login Button */}
        <button 
          type="submit"
          className="px-6 py-2 bg-white border border-gray-300 rounded hover:bg-gray-50"
        >
          Login
        </button>

        {/* Register Link */}
        <div className="mt-6">
          Don't have an account?{' '}
          <a href="/register" className="text-blue-600 underline">Register</a>
        </div>
      </form>
    </div>
  );
};

export default LoginPage;
